INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1001, 0, 0, "お！\nあそこに困ってそうな人発見！", 2, 0, 1, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "春咲 ひより", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1002, 0, 0, "大切な人を\n守れるようになりたい…って", 2, 0, 1, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 0, "草野 優衣", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1003, 0, 0, "キミに必要な集中力と感性が", 2, 0, 1, 0, "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 0, "士条 怜", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1004, 0, 0, "今日はなにして遊ぶ？", 2, 0, 1, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 0, "穂高 みそぎ", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1006, 0, 0, "ねぇ…", 2, 0, 1, 0, "私といっしょに…\nいかない？", "風宮あかりです", 0, "風宮 あかり", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1007, 0, 0, "プリンたべたいのー", 2, 0, 1, 0, "食べ物の恨みは怖いのー", "出雲宮子なのー", 0, "出雲 宮子", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1008, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 0, 1, 0, "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 0, "虹村 雪", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1009, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 0, 1, 0, "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 0, "柊杏奈", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1010, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 0, 1, 0, "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 0, "姫宮 真歩", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1011, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 2, 0, 1, 0, "ここで会ったが\n100年目～！", "衣之咲璃乃です！", 0, "衣之咲 璃乃", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1012, 0, 0, "ち、超能力って…\n何のことかな～？", 2, 0, 1, 0, "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "柏崎 初音", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1016, 0, 0, "一応カリスマ読モJKやってまっす！", 2, 0, 1, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 0, "美波 鈴奈", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1017, 0, 0, "東京は遊園地みたいなところさー", 2, 0, 1, 0, "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 0, "喜屋武 香織", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1018, 0, 0, "先生って呼ばれるのは\nくすぐったいから", 2, 0, 1, 0, "イオちゃんって呼んでね。", "支倉伊緒です。", 0, "支倉 伊緒", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1020, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 2, 0, 1, 0, "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "茜 ミミ", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1021, 0, 0, "あの……\nふぇ……", 2, 0, 1, 0, "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "栗林 くるみ", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1022, 0, 0, "こんな私に貴重な時間を\n割いていただき、", 2, 0, 1, 0, "なんてありがとうございます！", "風宮よりです。\nあああああ！", 0, "風宮 より", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1023, 0, 0, "おにいちゃんどこいくの？\nえ？", 2, 0, 1, 0, "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "北条 綾音", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1025, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 2, 0, 1, 0, "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 0, "天野 すずめ", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1027, 0, 0, "あなたは…運命の……\n伴侶……", 2, 0, 1, 0, "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 0, "倉石 恵理子", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1028, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 0, 1, 0, "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "佐々木 咲恋", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1029, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 2, 0, 1, 0, "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 0, "桜井 望", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1030, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 2, 0, 1, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 0, "ニノン・ジュベール", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1031, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 2, 0, 1, 0, "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 0, "上喜 しのぶ", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1033, 0, 0, "けんども\nそれには足りないモンが…", 2, 0, 1, 0, "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", 0, "野戸まひる", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1034, 0, 0, "ちょっと緊張しちゃって…", 2, 0, 1, 0, "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "綾瀬 ゆかり", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1036, 0, 0, "知らない人とは話しちゃいけないので", 2, 0, 1, 0, "これ以上お話しすることは…\nないです！", "氷川鏡華…です", 0, "氷川 鏡華", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1038, 0, 0, "……あ、アラーム。", 2, 0, 1, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", 0, "柏崎 栞", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1040, 0, 0, "私、一人も友達がいなくて……", 2, 0, 1, 0, "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", 0, "双葉 碧", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1042, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 0, 1, 0, "そう思っています。", "三角千歌です。", 0, "三角 千歌", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1043, 0, 0, "あぁ？\nお前のそいつの仲間か？", 2, 0, 1, 0, "う、疑ってすまなかったな…", "安芸真琴だ。", 0, "安芸 真琴", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1044, 0, 0, "生けとし生ける全ての者よ！", 2, 0, 1, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", 0, "イリヤ・オーンスタイン", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1045, 0, 0, "ぐふふふふ……はっ！", 2, 0, 1, 0, "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", 0, "遠見 空花", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1046, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 0, 1, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "宮坂たまき", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1048, 0, 0, "それでは早速クエストに…", 2, 0, 1, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", 0, "大神 美冬", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1049, 0, 0, "クエストもバトルも\n掃除も洗濯も", 2, 0, 1, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", 0, "星野静流", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1050, 0, 0, "見ての通りの\nセクシー美少女で", 2, 0, 1, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", 0, "玉泉美咲", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1052, 0, 0, "？？？？", 2, 0, 1, 0, "？？？？", "？？？", 0, "リマ", 1, 1, 1.4);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1053, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "モニカ・ヴァイスヴィント", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1058, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "ペコリーヌ", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1059, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "コッコロ", 1, 1, 1.5);
INSERT INTO `v1_79f7a84fb23836a43e3f349e4b64f4bdebc971e7968adac45299ac5c0de0d480` VALUES (1060, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 0, "キャル", 1, 1, 1.5);
